import React, { useState } from "react";
import './element.css';

export const Element = ({plantID, plantTitle, plantImage, plantClick}) => {
    return(
        <div className="element_block">
            <p className="element_title">{plantTitle}</p>
            <div className="element_active">
            <img className="element_image" 
            src={plantImage} 
            alt={`picture with ${plantTitle}`} />
            <button className="element_button" onClick={plantClick}>Select</button>
            </div>
        </div>
    )
}
